// https://leetcode.com/problems/maximum-frequency-stack/
/**
 * time complexity
 *  - push : best O(1), worst O(n^2)
 *  - pop : best O(1), worst O(n)
 * space complexity
 *  - push : best O(n), worst O(n) + ?? (피라미트 형태의 수열로 공간 사용)
 *  - pop : O(1)
 * @constructor
 */
var FreqStack = function() {
  this.stack = []
  this.freqMap = []
};

/**
 * @param {number} x
 * @return {void}
 */
FreqStack.prototype.push = function(x) {
  this.stack.push(x)
  let i = 0
  while (i <= this.freqMap.length) {
    if (!this.freqMap[i]) {
      this.freqMap[i] = new Set()
      break
    } else if (!this.freqMap[i].has(x)) {
      break
    }
    i++
  }
  this.freqMap[i].add(x)
};

/**
 * @return {number}
 */
FreqStack.prototype.pop = function() {
  let maxFreqMap = this.freqMap[this.freqMap.length - 1]
  for (let i = this.stack.length - 1; i >= 0; i--) {
    let x = this.stack[i]
    if (maxFreqMap.has(x)) {
      maxFreqMap.delete(x)
      if (maxFreqMap.size === 0) {
        this.freqMap.pop()
      }
      return this.stack.splice(i, 1)[0]
    }
  }
  return null
};

// 0 <= x <= 10^9
// push 10000 in single test case
// pop 10000 in single test case
// push and pop 150000 in all test case
var obj = new FreqStack()
obj.push(5)
obj.push(7)
obj.push(5)
obj.push(7)
obj.push(4)
obj.push(5)

console.assert(obj.pop() === 5)
console.assert(obj.pop() === 7)
console.assert(obj.pop() === 5)
console.assert(obj.pop() === 4)

